import "footerimages.css"
import ACI from "../ACI_Logo_2012.jpg"

function footer(){
    return(
    <div className="background">
        <   img src={ACI} className = "icon"></img>
        <   img src="" className = "icon"></img>
        <   img src="" className = "icon"></img>
          
   
      
      
    </div>
     
    )
}

export default footer;
